	　　冻南极磷虾首次“登陆厦门”
</p>
<p>
	　　近日，厦门东渡检验检疫局对一批来自韩国的冻南极磷虾实施现场检验检疫并取样送检。该批南极磷虾共有14.4吨、货值1万多美元，这也是厦门口岸历史上首次进口南极磷虾。东渡检验检疫局在实施完现场检验检疫后即允许货物运往备案存储库暂存等待检验结果，以确保食品安全。
</p>
<p>
	　　据进口商介绍，南极磷虾不仅自身蛋白质含量高，而且赖氨酸、维生素a含量及其丰富，加上其生活海域无污染，是做为高级虾酱的首选原料。进口商表示，首批货物主要是为了磨合各个流程环节，后续将会有持续、大量的冻南极磷虾经由厦门口岸进口。
</p>
<p>
	　　为了促进水产品进口，保障国内市场供给，东渡检验检疫局坚持把关与服务并重原则，多管齐下又好又快的做好进境水产品的检验检疫工作。一是采用信用等级管理，实施差别化监管，为诚信企业提供更多通关便利，引导企业诚信经营。二是开展货物风险分析，针对产品风险等级制定相应的监管要求，下调低风险产品现场查验和抽样送检比例，加快通关效率，节约企业成本，提升企业进口产品市场竞争力。三是根据不同货物不同特性制定“因货制宜”查验模式。
</p>','45','1','0','980','zh-cn');
	　　山东聊城东阿县特色鲜明的现代渔业发展
</p>
<p>
	　　产业优势独特基础扎实。东阿县地处鲁西平原紧邻黄河114华里，境内河流纵横、坑塘密集、水丰质优，是黄河鲤鱼的主要原产地，淡水渔业优势独特。多年来，县委、县政府始终高度重视，各级业务部门大力支持，东阿渔业秉承“求实、创新、兴渔”理念，呈现出较快发展、健康发展、特色鲜明的良好态势，取得了显着成绩，先后被确定为“山东省商品鱼基地县”、“山东省渔业重点县”、“全国农业标准化养殖(淡水渔业)示范区”、“基层水产养殖技术推广体系改革与建设项目县”和“现代农业发展资金优质鱼产业项目县”、“全国渔业技术推广站示范站”，拥有省、部级水产健康养殖示范场和省级现代渔业示范园区，是全国唯一的“中国黄河鲤鱼之乡”。截止2015年底，全县水产总面积稳定在6.52万亩，其中水产养殖面积达到4.72万亩(主养黄河鲤鱼2.9万亩)、藕1.5万亩、苇0.3万亩。渔业总产值达到8.1亿元。近日，东阿县水产局受到省人力资源社会保障厅、省海洋与渔业厅、省公务员局的表彰，被授予“全省海洋与渔业系统先进集体”荣誉称号。
</p>
<p>
	　　品牌渔业创建前所未有。2013年东阿县人民政府下发东政发〔2013〕20号文件，明确“关于实施‘东阿黄河鲤鱼’品牌创建加快现代渔业发展的意见”。目前，全县已获得4处无公害水产品产地认定，东阿黄河鲤鱼、东阿中华鳖、东阿鲫鱼、东阿泥鳅等14个品次无公害产品认证，注册了“阿黄”、“洛神湖”、“水城鱼山”3个水产品商标，“东阿黄河鲤鱼”1个地理标志保护产品。“东阿黄河鲤鱼”地理标志保护证明商标已顺利通过公示，进入颁证阶段，“东阿黄河鲫鱼”地理标志保护证明商标被国家工商总局商标局正式受理。
</p>
<p>
	　　渔民合作组织方兴未艾。2010年以来，先后成立“华龙”、“绣青”、“庞苓”、“四季”、“保晶”、“水城鱼山”等十二家渔民专业合作社，总户数超过1000个，涉渔面积1.5万亩，真正起到了纽带和汇聚作用，成绩斐然，尤以“绣青”、“华龙”合作社更为突出。绣青水产养殖专业合作社，成立最早、社员最多，为首批“山东省渔民专业合作社省级示范社”，“聊城市农业科技创新型龙头企业”、“农业部水产健康养殖示范场”。该社主要打造“东阿黄河鲤鱼”地标品牌，净养精品黄河鲤鱼200吨以上。同时，加大黄河鲤鱼良种场建设力度，选育纯正亲本3000组，年繁育能力1亿尾，2015年顺利通过省级黄河鲤鱼良种场资格评审，被省海洋与渔业厅命名为“东阿黄河鲤省级良种场”。华龙渔业养殖专业合作社成立于2009年，是我县渔业合作社的后起之秀，发展迅速，目前有成员210户，养殖面积3000亩。是“山东省渔业协会理事单位”，省市级现代渔业示范创建单位2014年承担实施现代农业生产发展资金优质鱼产业项目，2015年被评为“山东省渔民专业合作社省级示范社”。
</p>
<p>
	　　“中国黄河鲤鱼之乡”任重道远。通过挖掘、传承黄河鲤鱼历史文化，东阿黄河鲤鱼产业得以快速发展。特别是2013年荣获“中国黄河鲤鱼之乡”之后，同时抢注“东阿黄河鲤鱼.cn”、“东阿黄河鲤鱼.中国”、“东阿黄河鲤鱼.com”三个域名进行品牌保护，编辑印制了《东阿有“鲤”(礼)》宣传册。“良种繁育基地”、“标准化健康养殖示范基地”、“休闲观光基地”、“餐饮旗舰店”等初具规模，逐渐形成了以“东阿黄河鲤鱼”为核心的产业体系，地方特色更加鲜明，前景更加广阔。
</p>
<p>
