	　　辽宁丹东:打响“丹东宽甸活鱼”新品牌"
</p>
<p>
	　　宽甸满族自治县境内拥有三江六河、三座大型水库。优良的水质，丰富的水产资源，使宽甸成为活鱼养殖的天然场所，养殖量和养殖面积居亚洲第一。2013年，宽甸淡水鱼出口示范区正式创建，示范区包括鸭绿江水丰水库、太平湾水库、太平哨水库，其中水丰水库为核心示范区，太平湾水库和太平哨水库为辐射区。据丹东出入境检验检疫局统计，宽甸淡水鱼出口示范区在该局注册登记的企业有12家，是我市活鱼出口的主要区域。
</p>
<p>
	　　然而，活鱼出口属于高风险鲜活水产品，其出口并不是件容易的事情。出口活鱼的质量、规格、农药残留量以及鱼在运输过程中的成活率都是影响活鱼出口品质的重要因素。2013年以来，在丹东出入境检验检疫局的指导帮助下，宽甸淡水鱼出口示范区加强了投入品的管理，药残和农残得到了有效控制，活鱼质量大幅提高，品牌效应和带动作用凸显。截至2015年12月31日，丹东出入境检验检疫局共检验检疫出境活鱼310批次/2021.3吨，货值793.82万美元，比2014年批次增长了91.54%，数重量增长了89.88%，货值增长了70.64%，丹东出口的食用活鱼实现了逆势增长。
</p>
<p>
	　　记者采访了解到，为了严格控制活鱼的品质，积极推进宽甸淡水鱼出口示范区建设并确保通过省级示范区评定，丹东出入境检验检疫局主动向市农委、宽甸满族自治县政府和水产部门通报鸭绿江流域近三年来出口活鱼的出口量、养殖规模、出口贸易额、注册养殖场数量等信息，并提供出口活鱼示范区建设的规定要求。通过加强对养殖场相关人员的培训和指导，使辖区内养殖场的技术标准化和管理规范化得到了加强和统一。他们还与出口养殖企业建立紧密联系，通过微信平台和QQ群，将国家、省有关部门的法律法规和国外技术壁垒措施及时告知养殖企业，为企业提高国际竞争力、规避贸易风险起到了积极的作用。
</p>
<p>
	　　“近年来，我们通过帮助支持宽甸加大淡水鱼出口示范区建设，狠抓质量安全，使我们丹东出口的淡水鱼凭借过硬的质量实现了100%检测合格、100%顺利通关。现在，我们丹东宽甸活鱼在韩国市场已经成了一个响当当的品牌。”丹东出入境检验检疫局动植物检验检疫科科长张荣海说。
</p>','34','1','0','982','zh-cn');
	　　湖北孝感市大悟县“小泥鳅”建成大产业
</p>
<p>
	　　上月， 由大悟县水产局扶持湖北鑫磊农林发展有限公司研发的糖醋、奥尔良、麻辣、卤香四种口味即食泥鳅系列食品投入市场。该产品改变大悟泥鳅过去单一卖活体状况，实现了泥鳅产业链的突破。
</p>
<p>
	　　近两年来，大悟县抓住大悟泥鳅被列入国家级水产种质资源保护区和产业精准扶贫的机遇，做好“小泥鳅，大产业”的文章，大力推进泥鳅养殖一、二、三产业融合和“一县一品”建设，使泥鳅养殖业成为农民增收、农业增效、渔业增收的新产业。
</p>
<p>
	　　大悟水产部门通过“以苗代补”的方式，积极引导鼓励农民群众自发养殖泥鳅，养殖面积由2014年的不足500亩发展到现在2600亩。
</p>
<p>
	　　泥鳅养殖面积受地理限制，该县抓住“一高三新”农业发展方向，大力推广稻田综合种养，重点发展“稻鳅共作”、“藕鳅共作”种养模式，以及工厂化精养模式的试验。在阳平镇朱岗村建设了120亩“藕鳅共生”示范基地，在城关镇枣棚村、三里城镇汪畈村建设了110亩“稻鳅共生”示范基地。试验示范显示，每亩田比常规农业种植增加产值4500元以上，生态和经济效益显着。目前，这两种综合种养模式已进入规模推广阶段。
</p>
<p>
	　　在泥鳅产业规模发展初显成效之时，该县注重与之相匹配的泥鳅产业体系的建设。省级龙头企业湖北楚天红食品有限公司兴建泥鳅饲料加工厂，在县域内就近供应，为泥鳅产业发展提供有力支撑。“吕王泥鳅”通过在淘宝网、武汉农博会进行活体销售，实现产品价值倍增。湖北鑫磊农林科技公司开发泥鳅休闲食品，增加产品附加值，延伸了产业链条。
</p>','47','1','0','0','zh-cn');
	　　海南检验检疫局　帮扶企业进口亲虾
</p>
<p>
	　　海南是我国重要的南美白对虾虾苗培育基地。为促进优质亲虾的引进，有效解决国内对虾产业面临的种源退化、亲虾携带病原等难题，海南检验检疫局采取四项措施帮扶海南企业进口亲虾。2015年全年共完成检验检疫进口南美白对虾(亲虾)107批、14万尾、货值601.2万美元，同比分别增长35.4%，36.4%和28.7%，预计可产虾苗300多亿尾，将有效支撑海南省乃至全国对虾养殖业的发展。
</p>
<p>
	　　一是加大进境前技术指导。充分发挥技术优势，对首次进口种虾的企业，提前宣贯相关法律法规，提供国内外相关信息，并选派业务骨干指导企业隔离场建设，对企业的软硬件建设提出合理建议;二是简化入境报检手续。针对亲虾相关证书随货物到达的实际情况，结合进口企业诚信评级，推行无纸化报检或企业提前以证单复印件报检，施检时再核查证书正本，为货物及时检疫争取了时间;三是加速进境检疫验放。因航班原因，进境亲虾到达企业隔离场时多在凌晨2点左右，一线检疫人员践行“5+2”“白加黑”的服务承诺，第一时间赶到现场认真核查货证、检疫抽样，有效缩短核放时间，降低亲虾死亡率;四是严格后续监管。要求企业严格亲虾隔离检疫期各操作环节，及时核查企业的投喂、水质、用药、防疫消毒和疫情疫病等情况，督促企业落实亲虾隔离检疫期的管理制度、防疫制度，有效提高企业防范水产品疫病能力。
</p>','37','1','0','983','zh-cn');
	　　江苏高邮市三垛镇举办罗氏沼虾养殖技术培训班
