	　　浙江云和县召开特色水产养殖产业发展研讨会
</p>
<p>
	　　近日，由浙江省科技团队特派员—云和水产养殖业和云和县云河渔业专业合作社联合社联合举办的“云和县特色水产养殖产业发展研讨会”在云和县紧水滩镇成功举行。来自省、市、县20余个单位部门专家、学者、领导与会，云和县科技局副局长卢洋海出席，研讨会以“科技支撑与品牌发展”为主题，就云和水产业存在的养殖技术普遍低、品牌发展严重滞后、生产组织化程度低、信贷支撑发展较弱等相关问题进行了深入研讨，并有针对性地提出了今后的发展思路和对策建议。
