	　　福建明溪县双管齐下严抓水产苗种整治
</p>
<p>
	　　为规范水产苗种生产行为和市场秩序，促进水产苗种质量的提高，确保渔民权益和养殖质量安全。近日，福建三明市明溪县农业局组织渔政执法人员在全县范围内开展了一次水产苗种专项整治活动。
</p>
<p>
