	　　寒潮来袭　海鲜市场普涨一成
</p>
<p>
	　　连日来气温骤降，让热闹的海鲜市场也迎来一波“寒潮”。昨天，记者走访温州市区菜场发现，新鲜的水产品较半个月前已有所减少，价格受运输和打捞量减少影响，普遍上涨一成左右。
</p>
<p>
	　　昨天下午5时许，记者在温州市区兴文里农贸市场发现，鲜活海鲜数量较以往有所减少，取而代之的是带鱼、乌贼等冰冻类海鲜和部分干货。据市场里的海鲜商贩赵先生介绍，从前天开始，平时走货量很大的鲳鱼，价格接近翻倍地上涨，“十天前，规格在五两以上的鲳鱼批发价是140元一斤，昨天卖到210元一斤。”赵先生告诉记者，这几天受寒潮气候影响，渔民出海捕捞次数减少，鲳鱼的供应量明显下降，是导致价格猛涨的主要因素。另一个价格上涨比较明显的品种要数野生江蟹，“五两以上的基本卖到180元一斤，品质好的还要更贵。”赵先生说。据了解，受寒潮影响，市场上海鲜的整体价格都在走高，普遍上涨了一成左右。
</p>
<p>
	　　“寒潮来袭会使渔民出海次数减少，捕捞量下降，冷冻类海鲜将逐渐取代鲜活类海鲜成为市场主角。”浙福边贸水产城的信息记录员陈先生分析。
</p>','39','1','0','987','zh-cn');
	　　安徽铜陵市推进水产养殖政策性保险实施
</p>
<p>
	　　日前，铜陵市相关部门在义安区农业局召开了由近30位水产养殖大户参加的市水产养殖政策性保险推进会，以通过解读政策和以会代训的形式，推进市农业和财政部门联合出台的水产养殖政策性保险的实施。
</p>
<p>
	　　铜陵市境内水资源丰富、水质好，为水产养殖创造了有利条件。据农业部门统计，我市仅义安区境内的水产养殖面积就超5万亩，其中规模在50亩以上的养殖户就有200多户。但是由于水产养殖是“水中求财”，极易遭受自然灾害和病害影响，尤其是高密度的水产养殖，病害和自然灾害影响往往更为明显。
</p>
<p>
	　　自然灾害和病害给水产养殖户带来损失，备受市相关部门重视。为进一步发挥农业保险功能，切实维护广大水产养殖者的利益，有效化解生产过程中的风险，为渔业生产稳定健康发展和农民增收提供风险保障，市农业和财政部门决定自2015年12月至2018年12月开展水产养殖政策性保险试点。根据出台的实施方案，水产养殖政策性保险经办机构为国元保险铜陵中心支公司，试点范围为我市所辖区和普济圩农场，保险标的为符合投保条件的养殖水产品，保险期限由投保人和保险人协商确定，最长不超过一年。池塘精养和特种养殖每亩保险费为174元，大水面及池塘半精养每亩保费为40.8元。根据相关精神，我市确定水产养殖保险农户只承担25%，财政补贴75%。当水产养殖者养殖的水产品因自然灾害和病害等原因造成损失时，保险公司将按照约定的保险责任、保险标准，在规定的期限内进行灾害赔付。
</p>
<p>
	　　据悉，水产养殖政策性保险一经推出后，铜陵四季养殖公司便与国元保险铜陵中心支公司签订了我市水产养殖政策性保险首单。首单投保水面1300亩，年保费53040元。其他一些养殖企业也表现了强烈的投保意向。为推进该项政策的实施，当天上午，我市又召开由养殖大户代表参加的市水产养殖政策性保险推进会。会上，市农委和国元保险铜陵中心支公司的相关人员，带领参会者学习了政策内容，对承保和理赔流程等进行了解读等。不少参会的养殖大户表示，鱼苗投放结束就与该公司联系，为所饲养的鱼儿上道“保险”。
</p>
<p>
	　　国元保险铜陵中心支公司负责人表示，为推进水产养殖政策性保险这一惠民政策的实施，该公司将对养殖户进行摸底调查，加大政策宣传和讲解等，让养殖户明明白白投保，同时规范承保，充分发挥农业保险的“保护伞”作用。
</p>','50','1','0','988','zh-cn');


