	</div>
	<p>
		“<span>海之梦</span>”团队初创于1993年， 经过近二十年的发展，产业链结构较为完善。现公司总部占地300多亩，职工3000多人，其中
    技术人员200余人。拥有世界级先进的生产工艺和机械设备，总资产5亿多元。下属13个公司。主要从事远洋捕捞、水产品与农副
    产品种养殖观光、终端产品研发、加工与销售和连锁经营为一体；并拥有8500亩水果种植和水产养殖协约基地。年产海捕鱼罐头2
    万吨、冷冻水产品5万吨、冻煮鱼肉1万吨、果蔬罐头2万吨的生产能力。并拥有自己的海洋捕捞和速冻船队，速冻能力1000吨/次
    ，冷藏库3.8万多吨。
	</p>
	<p>
		公司在罐头产品的产、销量中一直名列国内该行业前茅，同时也是知名的水产加工、销售企业之一。下属品牌海之梦、桔花 
    、L5、奥林达等在美国、日本、韩国以及东南亚国家有着较高的知名度和影响力；其产品有海捕冷冻、海鲜礼包、水产罐头、冷
    冻鱼糜、调理食品、营养鱼/虾/肉稣、休闲食品、水果罐头、婴幼儿果泥等系列，远销国内外各个地区。
	</p>
