	　　我们的原料——纯净、无污染、无公害、绿色。
</p>
<p>
	　　原料产区：
</p>
<p>
	　　公司位于全国海岸带中段，临近台州最大港口海门港，附近海湾包括台州湾、台州列岛、东矶列岛。该海域面积和水产产量居浙江省首位，盛产数十种经济鱼类，2011年水产品产量43.21万吨。是海之梦水产原料的主要来源。沿海潮间带海涂养殖业基地，长316.73公里，淤涨型海涂面积62.93万亩(主要分布在台州湾，适于大规模开发)。
</p>
<p>
	　　近海捕鱼区位于东海区 186-188,191-194,197-200,204-207海域，渔场的方位经过精心计量过。水质优良，气温适宜，饵料充足，是水生动物生活的天堂。
</p>
<p>
	　　海域涉及主要鱼类有：水生动物：贝类、螺类、鳗鱼、弹涂鱼、青蟹、梭子蟹、脊尾白虾、腔肠类13种、棘皮类10种。
</p>
<p>
	　　鱼类212种，甲壳类79中，头足类12种。
</p>
<p>
	　　洄游性：带鱼、鲳鱼、大小黄鱼、马鲛、鲐鱼、日本鳀鱼、曼氏无针乌贼、中国对虾、日本对虾、长毛对虾、中华管鞭虾，鹰爪虾，哈氏仿对虾，三疣梭子蟹。
</p>
<p>
	　　岛礁类：石斑鱼、裮菖鲉、六线鱼、黑鲷、花尾胡椒鲷、锈斑蟳。
</p>
<p>
	　　大黄鱼，又名黄花鱼，主要分布于大平洋北部浅海。我国东海黄海、渤海沿海，辽宁省沿海等，其中大黄色分布于黄海南部、东海和南海，小黄鱼分布于我国黄海、渤海、东海及朝鲜西海岸，以舟山渔场产的大黄鱼最出名。海之梦的大黄鱼主要产自夏季端阳节前后，小黄鱼产自清明至谷雨时鱼汛时的东海舟山渔区及黄海等海域优质黄鱼产区。
</p>
<p>
	　　带鱼又叫刀鱼、牙带鱼，分布比较广，以西太平洋和印度洋最多，我国沿海各省均可见到，其中又以东海产量最高。海之梦的带鱼主要产自春、秋冬鱼汛时节的东海等海域优质带鱼产区。
</p>
<p>
	　　鲳鱼，主要分布于东海、南海。海之梦的鲳鱼主要产自在5,6月份洄游鱼汛期间的东海等海域优质鲳鱼产区。
</p>
<p>
	　　沙丁鱼，最初在意大利萨丁尼亚捕获而得名，主要分布于南北纬度6～20度的等温带海洋。海之梦的沙丁鱼主要产自东南沿海、北美西部、南美西部、日本、澳大利亚与南非沿岸等优质沙丁鱼产区。
</p>
<p>
	　　金枪鱼是一种大型远洋性重要商品食用鱼。分布在印度洋、太平洋中部与大西洋中部。海之梦的沙丁鱼主要产自夏秋冬鱼汛期间的东海、南海、太平洋中部等优质金枪鱼产区。
</p>
<p>
	　　青占鱼，又名鲐鱼，分布于北太平洋西部，中国、朝鲜、日本及俄罗斯远东地区。分为两个地方种群：一在日本海，一在黄海和东海。为北太平洋西部主要经济鱼类之一。海之梦的青占鱼主要产自春秋汛期间的东海、黄海等优质沙丁鱼产区。
</p>
<p>
	　　马鲛鱼，分布于北太平洋西部、我国产于东海、黄海和渤海。海之梦的马鲛鱼主要产自春、夏、秋汛舟山海域等优质马鲛鱼产区。
</p>
<p>
	　　中国对虾，主要分布于我国黄渤海和朝鲜西部沿海。海之梦的中国对虾主要产自春秋季节的黄渤海区域等优质中国对虾产区。
</p>
<p>
	　　日本对虾，俗称花虾，竹节虾，主要产于中国的渤海、黄海及朝鲜的西部沿海，日本北海道以南、东南亚、澳大利亚北部、非洲东部及红海等地。海之梦的日本对虾主要产自对冬春季节虾汛期间的渤黄海区域等优质日本对虾产区。
</p>
<p>
	　　三疣梭子蟹，俗称梭子蟹，分布于中国南北各海域、日本、朝鲜、马来群岛、红海。海之梦的三疣梭子蟹主要产自东海、南海等优质三疣梭子蟹产区。
</p>
<p>
	　　远洋捕鱼区遍布世界各个海域。
</p>
<p>
	　　捕捞：
</p>
<p>
	　　海之梦在休渔期前后(秋冬季节鱼肥的时候)，远洋捕捞船和远洋运输船变开往世界各个鱼产丰富优质的海域进行工作。企业临近浙江沿海四大中型海港之一的 海门港和中国最大的天然渔港及世界著名三大渔港之一的“舟山渔港”，掌握了行业优质的第一受渔业资源。
</p>
<p>
	　　海之梦坚持渔业的可持续发展。保护渔业资源的正常繁衍生息，使之达到永续与合理利用则是休渔意义的重要方面。
</p>
<p>
	　　捕捞技术：
</p>
<p>
	　　1、通过采用先进的声纳鱼探设备和技术，摸清海域鱼类资源现存量及水平、垂直分布规律，为捕捞生产“导航”。
</p>
<p>
	　　2、引进先进的渔具、渔法，提高捕捞生产效率。
</p>
<p>
	　　3、捕鱼时间主要在晚上，趁鱼群浮于水面取食浮游生物时施之;捕后将鱼浸于盐水运送上岸。
</p>
<p>
	　　如：对于沙丁鱼等在晚间会被光亮吸引的鱼种，一般采用灯光围网、流刺网 、大拉网和定置网等捕捞。
</p>
<p>
	　　金枪鱼的捕捞方式有两种，一种是延绳钓捕捞方法，主要捕捞栖息在较深海域的蓝鳍金枪鱼、马苏金枪鱼、大眼金枪鱼、黄鳍金枪鱼和长鳍金枪鱼，体重在20千克以上;另一种是表层渔具捕捞方法，包括围网、竿钓和曳绳钓等，捕捞栖息在海洋表层的金枪鱼，捕捞的品种主要是小个体的黄鳍金枪鱼、大眼金枪鱼和鲣鱼，体重范围是5～10千克。
</p>
<p>
	　　采购
</p>
<p>
	　　海之梦在东海渔场建立了一级品统购的“绿色通道”。专业采购人员在选择原料时，不管是海产类还是其他特产类食品，我们都选择的是优质健康的原料，公司专业采购人员在选择原料时，都是从原产地挑选优质健康绿色的产品，从源头上保障质量。海产类我们精选的野生黄鱼，东海野生梭子蟹、东海海鳗、东海野生红膏白蟹、近海鳗等等。(放几张挑选检验的照片)
</p>
<p>
	　　养殖
</p>
<p>
	　　公司健全产业链，按照市场、客户和消费者需求，引入优良品种，提升养殖效率。挑选台州沿海河口淡水交汇处，河港交错，潮流通畅，水质肥沃，饵料丰富。在台州近海滩涂进行水产养殖。通过合理管理，养殖水平和产品品质达到优质水平，并将物流、加工、品牌渠道和销售连接在一起，完成了一条成熟的产业链体系。
</p>','1','品质体系','品质体系','zh-cn');
  <h1>原料来源</h1>
  <h4>RAW MATERIAL SOURCE</h4>
  <img  src="/Uploads/image/page/20160131/xian.jpg">
</div>


<div class="ylly1">
<p><img src="/Uploads/image/page/20160131/ylly.jpg"></p>
<P>　　我们的原料——纯净、无污染、无公害、绿色。</P>
<P>　　原料产区：</P>
<P>　　公司位于全国海岸带中段，临近台州最大港口海门港，附近海湾包括台州湾、台州列岛、东矶列岛。该海域面积和水产产量居浙江省首位，盛产数十种经济鱼类，2011年水产品产量43.21万吨。是海之梦水产原料的主要来源。沿海潮间带海涂养殖业基地，长316.73公里，淤涨型海涂面积62.93万亩(主要分布在台州湾，适于大规模开发)。</P>
<P>　　近海捕鱼区位于东海区 186-188,191-194,197-200,204-207海域，渔场的方位经过精心计量过。水质优良，气温适宜，饵料充足，是水生动物生活的天堂。</P>
<P>　　海域涉及主要鱼类有：水生动物：贝类、螺类、鳗鱼、弹涂鱼、青蟹、梭子蟹、脊尾白虾、腔肠类13种、棘皮类10种。</P>
<P>　　鱼类212种，甲壳类79中，头足类12种。</P>
<P>　　洄游性：带鱼、鲳鱼、大小黄鱼、马鲛、鲐鱼、日本鳀鱼、曼氏无针乌贼、中国对虾、日本对虾、长毛对虾、中华管鞭虾，鹰爪虾，哈氏仿对虾，三疣梭子蟹。</P>
<P>　　岛礁类：石斑鱼、裮菖鲉、六线鱼、黑鲷、花尾胡椒鲷、锈斑蟳。</P>
<P>　　大黄鱼，又名黄花鱼，主要分布于大平洋北部浅海。我国东海黄海、渤海沿海，辽宁省沿海等，其中大黄色分布于黄海南部、东海和南海，小黄鱼分布于我国黄海、渤海、东海及朝鲜西海岸，以舟山渔场产的大黄鱼最出名。海之梦的大黄鱼主要产自夏季端阳节前后，小黄鱼产自清明至谷雨时鱼汛时的东海舟山渔区及黄海等海域优质黄鱼产区。</P>
<P>　　带鱼又叫刀鱼、牙带鱼，分布比较广，以西太平洋和印度洋最多，我国沿海各省均可见到，其中又以东海产量最高。海之梦的带鱼主要产自春、秋冬鱼汛时节的东海等海域优质带鱼产区。</P>
<P>　　鲳鱼，主要分布于东海、南海。海之梦的鲳鱼主要产自在5,6月份洄游鱼汛期间的东海等海域优质鲳鱼产区。</P>
<P>　　沙丁鱼，最初在意大利萨丁尼亚捕获而得名，主要分布于南北纬度6～20度的等温带海洋。海之梦的沙丁鱼主要产自东南沿海、北美西部、南美西部、日本、澳大利亚与南非沿岸等优质沙丁鱼产区。</P>
<P>　　金枪鱼是一种大型远洋性重要商品食用鱼。分布在印度洋、太平洋中部与大西洋中部。海之梦的沙丁鱼主要产自夏秋冬鱼汛期间的东海、南海、太平洋中部等优质金枪鱼产区。</P>
<P>　　青占鱼，又名鲐鱼，分布于北太平洋西部，中国、朝鲜、日本及俄罗斯远东地区。分为两个地方种群：一在日本海，一在黄海和东海。为北太平洋西部主要经济鱼类之一。海之梦的青占鱼主要产自春秋汛期间的东海、黄海等优质沙丁鱼产区。</P>
<P>　　马鲛鱼，分布于北太平洋西部、我国产于东海、黄海和渤海。海之梦的马鲛鱼主要产自春、夏、秋汛舟山海域等优质马鲛鱼产区。</P>
<P>　　中国对虾，主要分布于我国黄渤海和朝鲜西部沿海。海之梦的中国对虾主要产自春秋季节的黄渤海区域等优质中国对虾产区。</P>
<P>　　日本对虾，俗称花虾，竹节虾，主要产于中国的渤海、黄海及朝鲜的西部沿海，日本北海道以南、东南亚、澳大利亚北部、非洲东部及红海等地。海之梦的日本对虾主要产自对冬春季节虾汛期间的渤黄海区域等优质日本对虾产区。</P>
<P>　　三疣梭子蟹，俗称梭子蟹，分布于中国南北各海域、日本、朝鲜、马来群岛、红海。海之梦的三疣梭子蟹主要产自东海、南海等优质三疣梭子蟹产区。</P>
<P>　　远洋捕鱼区遍布世界各个海域。</P>
<P>　　捕捞：</P>
<P>　　海之梦在休渔期前后(秋冬季节鱼肥的时候)，远洋捕捞船和远洋运输船变开往世界各个鱼产丰富优质的海域进行工作。企业临近浙江沿海四大中型海港之一的 海门港和中国最大的天然渔港及世界著名三大渔港之一的“舟山渔港”，掌握了行业优质的第一受渔业资源。</P>
<P>　　海之梦坚持渔业的可持续发展。保护渔业资源的正常繁衍生息，使之达到永续与合理利用则是休渔意义的重要方面。</P>
<P>　　捕捞技术：</P>
<P>　　1、通过采用先进的声纳鱼探设备和技术，摸清海域鱼类资源现存量及水平、垂直分布规律，为捕捞生产“导航”。</P>
<P>　　2、引进先进的渔具、渔法，提高捕捞生产效率。</P>
<P>　　3、捕鱼时间主要在晚上，趁鱼群浮于水面取食浮游生物时施之;捕后将鱼浸于盐水运送上岸。</P>
<P>　　如：对于沙丁鱼等在晚间会被光亮吸引的鱼种，一般采用灯光围网、流刺网 、大拉网和定置网等捕捞。</P>
<P>　　金枪鱼的捕捞方式有两种，一种是延绳钓捕捞方法，主要捕捞栖息在较深海域的蓝鳍金枪鱼、马苏金枪鱼、大眼金枪鱼、黄鳍金枪鱼和长鳍金枪鱼，体重在20千克以上;另一种是表层渔具捕捞方法，包括围网、竿钓和曳绳钓等，捕捞栖息在海洋表层的金枪鱼，捕捞的品种主要是小个体的黄鳍金枪鱼、大眼金枪鱼和鲣鱼，体重范围是5～10千克。</P>
<P>　　采购</P>
<P>　　海之梦在东海渔场建立了一级品统购的“绿色通道”。专业采购人员在选择原料时，不管是海产类还是其他特产类食品，我们都选择的是优质健康的原料，公司专业采购人员在选择原料时，都是从原产地挑选优质健康绿色的产品，从源头上保障质量。海产类我们精选的野生黄鱼，东海野生梭子蟹、东海海鳗、东海野生红膏白蟹、近海鳗等等。(放几张挑选检验的照片)</P>
<P>　　养殖</P>
<P>　　公司健全产业链，按照市场、客户和消费者需求，引入优良品种，提升养殖效率。挑选台州沿海河口淡水交汇处，河港交错，潮流通畅，水质肥沃，饵料丰富。在台州近海滩涂进行水产养殖。通过合理管理，养殖水平和产品品质达到优质水平，并将物流、加工、品牌渠道和销售连接在一起，完成了一条成熟的产业链体系。</P>

</div>','1','原料来源','原料来源','zh-cn');
